contracts/BlocVote.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;
import {IBlocVote} from './interface/IBlocVote.sol';

contract BlocVote is IBlocVote {
    address public immutable deployer = msg.sender;
    address public chairman;

    Vote[] public votes;
    Candidate[] public candidates;
    Office[] public offices;

    modifier OnlyChairman() {
        require(msg.sender == chairman, "unauthorized");
        _;
    }

    constructor(address _deployer) {
        chairman = _deployer;
    }

    function changeChairman(address _newChairman) external OnlyChairman() {
        chairman = _newChairman;
    }

    // candidate operation

    function registerCandidate(string calldata _name, uint _officeId) external {
        uint index = candidates.length;
        Candidate memory candidate = Candidate({
            name: _name,
            officeId: _officeId,
            votes: 0,
            id: index,
            isValid: true
        });

        uint candidateCountForOffice = offices[_officeId].candidatesCount;

        offices[_officeId].candidatesCount = candidateCountForOffice++;
        candidates.push(candidate);
    }

    function removeCandidate(uint _candidateId) external {
        candidates[_candidateId].isValid = false;
    }

    function reactivateCandidate(uint _candidateId) external {
        candidates[_candidateId].isValid = true;
    }

    // office operation

    function registerOffice(string calldata _name) external {
        uint index = offices.length;
        Office memory office = Office({
            id: index,
            name: _name,
            isValid: true,
            candidatesCount: 0
        });

        offices.push(office);
    }

    function removeOffice(uint _officeId) external {
        offices[_officeId].isValid = false;
    }

    function reactivateOffice(uint _officeId) external {
        offices[_officeId].isValid = true;
    }

    // voting process
    function castVote(Vote[] memory _votes) external {
        uint _index;

        for (_index; _index < _votes.length; _index++) {
            votes.push(_votes[_index]);
        }
    }

    function candidateResult(uint _candidateId) external view returns (uint) {
        uint _votes = candidates[_candidateId].votes;
        return _votes;
    }

    function getResult() external view returns (Result[] memory) {
        Result[] memory results = new Result[](candidates.length);

        for (uint _index; _index < candidates.length; _index++) {
            if (candidates[_index].isValid) {
                results[_index] = Result({
                    candidateId: _index,
                    officeId: candidates[_index].officeId,
                    votes: candidates[_index].votes
                });
            }
        }
        return results;
    }
}

contracts/ContractFactory.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity 0.8.24;

import './BlocVote.sol';

contract ContractFactory {
    BlocVote[] blocvoteContracts;

    function deploy() external returns (BlocVote) {
        BlocVote contr = new BlocVote(msg.sender);
        blocvoteContracts.push(contr);

        return contr;
    }

    function deployedContracts() external view returns (BlocVote[] memory) {
        return blocvoteContracts;
    }

    function latestDeploy() external view returns (BlocVote){
        return blocvoteContracts[blocvoteContracts.length];
    }
}

contracts/interface/IBlocVote.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;

interface IBlocVote {
    struct Candidate {
        uint id;
        string name;
        uint officeId;
        bool isValid;
        uint votes;
    }

    struct Office {
        uint id;
        string name;
        bool isValid;
        uint candidatesCount;
    }

    struct Vote {
        uint candidateId;
        uint officeId;
    }

    struct Result {
        uint candidateId;
        uint officeId;
        uint votes;
    }


    // administration
    function changeChairman(address _newChairman) external;

    // candidate
    function registerCandidate(string calldata _name, uint _officeId) external;
    function removeCandidate(uint _candidateid) external;
    function reactivateCandidate(uint _candidateId) external;

    // office
    function registerOffice(string calldata _name) external;
    function removeOffice(uint _officeId) external;
    function reactivateOffice(uint _officeId) external;

    // vote processing
    function castVote(Vote[] memory _vote) external;
    function getResult() external returns (Result[] memory);
    function candidateResult(uint candidateId) external view returns (uint);
}

